using Xunit;
using System;
using SuperDigit;

namespace SuperDigitTest
{

    public class Test
    {
        [Fact]
        public void SuperDigitShouldReturnValue()
        {

            Assert.Equal(2, Program.SuperDigit("1234", 2));
            Assert.Equal(3, Program.SuperDigit("1234", 3));
            Assert.Equal(4, Program.SuperDigit("1234", 4));
            Assert.Equal(3, Program.SuperDigit("72159", 5));
            Assert.Equal(9, Program.SuperDigit("", 100000));

        }
    }
}